import React from "react";
import "./App.scss";

function App() {
  return (
    <div className="App">
      <header className="navbar">
        <div className="logo">
          <a href="/">
            <img
              src={require("../public/images/logo_pineapple.png")}
              alt="logo"
            />
          </a>
        </div>
      </header>
    </div>
  );
}

export default App;
